import React, { useState } from "react"
import styles from "./NavBar.module.css"
import MenuLink from "../../components/menuLink/MenuLink"
import CreateMenu from "../createMenu/CreateMenu"

const NavBar = () => {
  const [createMenuHidden, setCreateMenuHidden] = useState(true)
  const onHover = () => {
    console.log("hej")
    setCreateMenuHidden(!createMenuHidden)
  }
  return (
    <div className={styles.navBar}>
      <div className={styles.logo}>timeKeep</div>

      <div className={styles.menu}>
        <MenuLink name="Get Started" hover={onHover}></MenuLink>
      </div>
      {createMenuHidden ? null : (
        <div style={{ marginRight: 40, display: "inline-block" }}>
          <CreateMenu></CreateMenu>
        </div>
      )}
    </div>
  )
}
export default NavBar
